import base64
import json
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

from tools.utils import singleton

@singleton
class DataDecryptor:
    def __init__(self):
        self.current_data = None
        self.key = "dGZ0ZGFpYURleEVhbVZhag=="  # Base64 encoded key
    def decrypt_data(self, encrypted_data):
        try:
            # Decode the base64 key
            key_bytes = base64.b64decode(self.key)

            # Initialize AES cipher in ECB mode
            cipher = AES.new(key_bytes, AES.MODE_ECB)

            # Decrypt the data
            decrypted_bytes = cipher.decrypt(base64.b64decode(encrypted_data))

            # Unpad and decode to UTF-8
            decrypted_text = unpad(decrypted_bytes, AES.block_size).decode('utf-8')
            #print(decrypted_text)
            # Parse JSON and store result
            self.current_data = json.loads(decrypted_text)
            return self.current_data

        except Exception as e:
            print(f"Error decrypting data: {e}")
            return None
